import React, { useState } from "react";
import "./VideoList.css";

// APIkey=AIzaSyAtTWostq1MsBKVBHh6HeQ2bX6y6xj8YyE

const dummyVideos = [
  { title: "title 1", vid: "x7VfLpDIDN4" },
  { title: "title 2", vid: "PqiddY3o3aY" },
  { title: "title 3", vid: "a-cw5ybQ8ps" },
  { title: "title 4", vid: "ECZp_xpyxN0" },
  { title: "title 5", vid: "zWPsjhBaRb0" },
];

export default function VideoList(props) {
  const [video, setVideo] = useState(dummyVideos[0]);
  const clickHandler = () => {
    setVideo(video);
  };
  console.log(video);
  return (
    <div className="videos">
      <ul className="video-list">
        {dummyVideos.map((video) => {
          return (
            <li className="video" onClick={clickHandler}>
              {video.title}
            </li>
          );
        })}
      </ul>
    </div>
  );
}
